// src/components/VolumesDisplay.js
import React, { useEffect, useState } from 'react';

const VolumesDisplay = () => {
    const [volumes, setVolumes] = useState([]);

    useEffect(() => {
        fetch('http://127.0.0.1:5000/traffic_volume')
            .then(response => response.json())
            .then(data => setVolumes(data));
    }, []);

    return (
        <div>
            <h2>Traffic Volumes</h2>
            <ul>
                {volumes.map(volume => (
                    <li key={volume.id}>{`Request ID: ${volume.id}, Volume: ${volume.volume}`}</li>
                ))}
            </ul>
        </div>
    );
};

export default VolumesDisplay;
